import './App.css';
import NavBar from './Navbar';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
       <NavBar />
      <header className="App-header">

        <p>
          Today <code>3 June 2024</code> to staart the web developer Internship.
        </p>
                        4 TechStar Solutions.
      </header>
    </div>
  );
}

export default App;
